document.addEventListener("DOMContentLoaded",function(){var t=document.querySelectorAll(".gutena-forms-dashboard .select-change-url");if(0<t.length)for(let e=0;e<t.length;e++)t[e].addEventListener("change",function(){var e=this.getAttribute("url");null!=e&&(window.location=e+this.value)});var n=document.querySelectorAll(".gutena-forms-dashboard .gf-delete");if(0<n.length)for(let e=0;e<n.length;e++)n[e].addEventListener("click",function(e){e.preventDefault();e=this.getAttribute("href");null!=e&&window.confirm("Do you really want to delete this entry?")&&(window.location=e)})});